import React from "react";
import AddTags from "./AddTags";
import Nav from "./Nav";
import RandomData from "./RandomData";

export default function TagPage({ page, setPage }) {
  return (
    <>
      <Nav page={page} setPage={setPage}></Nav>
      <RandomData></RandomData>
      <AddTags></AddTags>
    </>
  );
}
//only show the addTags page if Data is available from the randomData call
//default addTags page to have an input
